Kelmės rajono savivaldybės sprendimu skrydžiai bepiločiais orlaiviais yra **draudžiami** virš šių objektų ir 200 metrų atstumu nuo objektų teritorijų ribų:

1. Telšių apskrities VPK Kelmės rajono PK;
2. Kelmės rajono apylinkės teismo;
3. Lietuvos kariuomenės Krašto apsaugos savanorių pajėgų Prisikėlimo apygardos 6-osios rinktinės 605 pėstininkų kuopos būstinės;
4. UAB „Kelmės vanduo“;
5. UAB „LITESKO“ filialo „Kelmės šiluma“;

Šaltinis: [teisės aktų registras](https://www.e-tar.lt/portal/lt/legalAct/c2de6fc0975511e5a6f4e928c954d72b)

Išimtis derinti su [Kelmės rajono savivaldybe](http://kelme.lt).

Šalčininkų rajono savivaldybės sprendimu skrydžiai bepiločiais orlaiviais yra **draudžiami** virš šių objektų:

1. 1 kilometro pločio juosta į abi puses nuo geležinkelio bėgių palei geležinkelio bėgius;
2. Valstybės teritorijos juostoje nuo valstybės sienos iki Stasylų geležinkelio pasienio kontrolės punkto;

